script: |
  super -f text -I q5032.spq | sort > q5032.out

inputs:
  - name: q5032.spq
    data: |
      SELECT DISTINCT * FROM tab2 (FORMAT parquet) AS cor0 WHERE NOT ( - + col0 ) NOT BETWEEN + 24 AND ( - + 42 + + 35 * + - col0 ) OR NOT NULL IS NOT NULL;
  - name: tab2

outputs:
  - name: q5032.out
    data: |
      46	51	23
      64	77	40
      75	67	58
